    mapping(address => uint256) public exchangeTimes;
    mapping(address => uint256) public negtiveValue;
}","keccak256":"0x5c378df1d5e2a5b28f3e5d31211f9f80ddd972b5fd42aba2b0c93211c989bf9f","license":"MIT"}},"version":1}

